import React from 'react'
import styles from '../c_iphone-14-1.module.css'
import bg from '../assets/bg.jpg'
import fontstyle from '../assets/fontstyle.png'
import rectangle1 from '../assets/rectangle1.png'
import gambar3 from '../assets/group1.png'


const Home = () => {
  return (
    <div className={styles['frame']}>
      <img
        src={bg}
        alt="rectangle"
        width={390}
        height={844}
        className={styles['rectangle']}
      />
      <img
        src={gambar1}
        alt="rectangle"
        width={390}
        height={252}
        className={styles['rectangle1']}
      />
      <img
        src={gambar3}
        alt="frame"
        width={100}
        height={150}
      />
      <div className={styles['text']}>
      </div>
      <div className={styles['text2']}>
        <p className={styles['text3']}>
          Jelajahi aplikasi ini dan mulai memasak makanan yang lezat!
        </p>
      </div>
      <img
        src={gambar2}
        alt="rectangle"
        width={319}
        height={51}
        className={styles['rectangle2']}
      />
      <div className={styles['text4']}>
        <p className={styles['text5']}>Get Started !</p>
      </div>
    </div>
  )
}

export default Home

